import React, { Component, Fragment } from 'react';
import PropTypes from 'prop-types';

class Autocomplete extends Component {
  constructor(props) {
    super(props);
    this.suggestions = [
      'Ronaldo',
      'Messi',
      'Neymar',
      'Mbappe',
      'De Bruyne',
      'Ramos',
      ''
    ];
  }

  render() {
    return (
      <div>
        <input
          onChange={e => {
            console.log(e.target.value);
          }}
        ></input>
      </div>
    );
  }
}

export default Autocomplete;
